import React from 'react'
import Sidebar from '../Sidebar'
import Groupchat from '../Groupchat'

const Body_groupchat = () => {
  return (
    <div id="body">
        <Sidebar />
        <Groupchat />
    </div>
  )
}

export default Body_groupchat
